import axios from 'axios';
import React, { useEffect, useState } from 'react';
import '../styles/FlightBookings.css';

const FlightBookings = () => {
  const [userDetails, setUserDetails] = useState();
  const [bookings, setBookings] = useState([]);

  useEffect(() => {
    fetchUserData();
    fetchBookings();
  }, []);

  const fetchUserData = async () => {
    try {
      const id = localStorage.getItem('userId');
      const response = await axios.get(`http://localhost:6001/fetch-user/${id}`);
      setUserDetails(response.data);
    } catch (err) {
      console.error(err);
    }
  };

  const fetchBookings = async () => {
    try {
      const response = await axios.get('http://localhost:6001/fetch-bookings');
      setBookings(response.data.reverse());
    } catch (err) {
      console.error(err);
    }
  };

  const cancelTicket = async (id) => {
    try {
      await axios.put(`http://localhost:6001/cancel-ticket/${id}`);
      alert("Ticket cancelled!!");
      fetchBookings();
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <div className="user-bookingsPage">
      {userDetails ? (
        userDetails.approval === 'not-approved' ? (
          <div className="notApproved-box">
            <h3>Approval Required!!</h3>
            <p>Your application is under processing. It needs approval from the administrator. Please be patient!</p>
          </div>
        ) : userDetails.approval === 'approved' ? (
          <>
            <h1 className="bookings-heading">Bookings</h1>
            <div className="user-bookings">
              {bookings
                .filter(
                  (booking) => booking.flightName === localStorage.getItem('username')
                )
                .map((booking) => (
                  <div className="user-booking" key={booking._id}>
                    <h4>Booking ID: {booking._id}</h4>
                    <div className="booking-info">
                      <p><strong>Mobile:</strong> {booking.mobile}</p>
                      <p><strong>Email:</strong> {booking.email}</p>
                      <p><strong>Flight Id:</strong> {booking.flightId}</p>
                      <p><strong>Flight Name:</strong> {booking.flightName}</p>
                      <p><strong>On-boarding:</strong> {booking.departure}</p>
                      <p><strong>Destination:</strong> {booking.destination}</p>
                      <p><strong>Booking Date:</strong> {booking.bookingDate.slice(0, 10)}</p>
                      <p><strong>Journey Date:</strong> {booking.journeyDate.slice(0, 10)}</p>
                      <p><strong>Journey Time:</strong> {booking.journeyTime}</p>
                      <p><strong>Total Price:</strong> â‚¹{booking.totalPrice}</p>
                      <p><strong>Status:</strong> {booking.bookingStatus === 'cancelled' ? <span style={{ color: 'red' }}>{booking.bookingStatus}</span> : booking.bookingStatus}</p>
                    </div>
                    <div className="passengers-section">
                      <strong>Passengers:</strong>
                      <ul>
                        {booking.passengers.map((passenger, i) => (
                          <li key={i}>{passenger.name}, Age: {passenger.age}</li>
                        ))}
                      </ul>
                      {booking.bookingStatus === 'confirmed' && <p><strong>Seats:</strong> {booking.seats}</p>}
                    </div>
                    {booking.bookingStatus === 'confirmed' && (
                      <button className="btn btn-danger cancel-btn" onClick={() => cancelTicket(booking._id)}>
                        Cancel Ticket
                      </button>
                    )}
                  </div>
                ))}
            </div>
          </>
        ) : null
      ) : null}
    </div>
  );
};

export default FlightBookings;
